import React from 'react';
import './Sidebar.css';

function Sidebar() {
  return (
    <div className='sidebar'>
        <div className='sidebarItem'>
            <span className='sidebarTitle'>ABOUT ME</span>
        </div>
    </div>
  )
}

export default Sidebar
